'use strict';
class UsedMarginProvider {
    storage;
    static create(storage) {
        let usedMarginProvider;
        usedMarginProvider = new UsedMarginProvider();
        usedMarginProvider.storage = storage;
        return usedMarginProvider;
    }
    get(accountId, leverageProfileId, offerId) {
        return this.storage.findMarginDescriptor(accountId, leverageProfileId, offerId);
    }
    find(accountId, leverageProfileId) {
        return this.storage.findMarginDescriptors(accountId, leverageProfileId);
    }
}
module.exports = UsedMarginProvider
